import React from 'react';
import { Provider } from 'react-redux';
import configureStore from './store/configStore';
const { store } = configureStore();
import AppResume from '.'

function App() {
  return (
    <>
    <Provider store={store}>
      <LayoutPage>
        <LeftContent>
          <Introduction/>
        </LeftContent>
        <RightContent>
          <Skill/>
          <Experience/>
          <Education/>
          <Interest />
          <Contact />
          <FooterPage />
        </RightContent>
      </LayoutPage>
    </Provider>
    </>
  );
}

export default App;
